import {Component} from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

  constructor(){
    super();
    this.state = {
      name:{firstName:'Tomeka', lastName:'Durling'},
      company: 'Self'
    }
  }

  render(){
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Hi, Im {this.state.name.firstName}{this.state.name.lastName}.  I work for {this.state.company}.
          </p>
          <button onClick = {()=>{
            this.setState({firstName: 'Tamara', lastName: 'Augustine'},);
            this.setState({company: 'Home'})
          }}> 
          Change Name</button>

        </header>
      </div>
    );  
  }
}

export default App;
